func (m circleSharingPreferenceMods) WithParentsCascading() CircleSharingPreferenceMod {
	return CircleSharingPreferenceModFunc(func(ctx context.Context, o *CircleSharingPreferenceTemplate) {
		if isDone, _ := circleSharingPreferenceWithParentsCascadingCtx.Value(ctx); isDone {
			return
		}
		ctx = circleSharingPreferenceWithParentsCascadingCtx.WithValue(ctx, true)
		{

			related := o.f.NewCircleWithContext(ctx, CircleMods.WithParentsCascading())
			m.WithCircle(related).Apply(ctx, o)
		}
		{

			related := o.f.NewUserWithContext(ctx, UserMods.WithParentsCascading())
			m.WithUser(related).Apply(ctx, o)
		}
	})
}

